import { db } from "../database";
import shortid from 'shortid';

//GET todos los deportes
export const getDeportes = {
    method: 'GET',
    path: '/deportes',
    handler: async (req, h) => {
      const { results } = await db.query(
        `SELECT * FROM Deportes`,
      );
      return results;
    }
  };

//GET 1 deporte
export const getDeporte = {
  method: 'GET',
  path: '/deportes/{id}',
  handler: async (req, h) => {
    const {id} = req.params;
    const { results } = await db.query(
      `SELECT * FROM Deportes WHERE id = ?;`,
      [id]
    );
    return results[0];
  }
};

//CREAR 1 deporte
