  method: 'PUT',
  path: '/deportes/{id}',
  handler: async (req, h) => {

    const {id} = req.params;
    const body = JSON.parse(req.payload);
    // Body example
    // {
    //   "nombre": "Tennis",
    //   "descripcion": "Deporte que se juega con una raqueta y una pelota",
